    render(){
let CreateRows = Object.keys(this.props.myStocks);
            rows = CreateRows.map(row => {
                return (
                    <tr>
                    <td>{row.symbol}</td>
                    <td>-</td>
                    <td>-</td>
                    <td>-</td>
                    <td>-</td>
                    <td>-</td>
                    <td>-</td>
                </tr>
                )})




        return (
            <div className="MyStock">
                <div className="Header">
                    <span className="MyStockTitle">My Stocks</span>
                </div>
                <div className="body">
                    <table id="MyStocksTable" className="MyStocksTable">
                        <thead>
                            <tr>
                                <th>Stock symbol</th>
                                <th>Stock name</th>
                                <th>No.of shares</th>
                                <th>Buy price</th>
                                <th>Current price</th>
                                <th>Profit/Loss</th>
                                <th>Stop Tracking</th>
                            </tr>
                        </thead>

                        <tbody>
                            {/* <tr>
                           createRows = () =>{ object.keys(props.myStocks.map(myStocks => {
